      "27": "hsl(2,57%,46%)",
      "28": "hsl(20,100%,16%)",
      "29": "hsl(25,63%,46%)",
      "30": "hsl(35,14%,43%)",
      "31": "hsl(55,26%,36%)",
      "32": "hsl(95,47%,35%)",
      "33": "hsl(57,57%,57%)",
      "34": "hsl(61,80%,61%)",
      "35": "hsl(55,53%,31%)",
